import React from 'react';
import './Home.css';
import Me from '../../assets/avatar-1.svg'; // Update this with your actual image if available
import HeaderSocials from './HeaderSocials';
import ScrollDown from './ScrollDown';
import Shapes from './Shapes';

const Home = () => {
    return (
        <section className="home container" id='home'>
            <div className="intro">
                <img src={Me} alt="Profile" className='home__img' width='120' />
                <h1 className="home__name">Sandhya Rani Narravula</h1>
                <span className="home__education">I'm a Computer Science Enthusiast & AI Researcher</span>

                <HeaderSocials />

                <a href="#contact" className="btn">Contact Me</a>

                <ScrollDown />
            </div>

            <Shapes />
        </section>
    );
}

export default Home;
